import { useState } from 'react';
import useForm from '../hooks/useForm';
import { useHistory } from 'react-router-dom'
import '../styles/Login.css';

const Login = () => {

    const history = useHistory();
    const [error, setError] = useState<string>('');
    const { user, pass, onChange } = useForm({
        user: '',
        pass: '',
    }, setError);

    const Login = (e: any) => {

        e.preventDefault();
        if(user === 'prueba' && pass === 'prueba'){
            //ACA LOGUEO
            history.push(`/MisAcciones`);
            setError('')
        }
        else{
            setError('Usuario o clave invalida');
        }
    }

    return (
        <div className="container form-login">
            <form>
                <div className="form-group">
                    <label htmlFor="usuario">Usuario</label>
                    <input type="text" className="form-control" autoComplete='off' onChange={(e) => onChange(e.target.value, 'user')} value={user} id="usuario" aria-describedby="emailHelp" placeholder="Usuario" />
                </div>
                <div className="form-group">
                    <label htmlFor="password">Clave</label>
                    <input type="password" className="form-control" autoComplete='off' onChange={(e) => onChange(e.target.value, 'pass')} value={pass} id="password" placeholder="Clave" />
                </div>
                {
                    error && <div className='error'>{error}</div>
                }
                <div className='login'>
                    <br></br>
                    <button onClick={login} className="btn btn-primary">Login</button>
                </div>
            </form>
        </div>
    )
}

export default Login;
